// Loop over input items and add a new field called 'myNewField' to the JSON of each one
for (const item of $input.all()) {
  item.json['fecha_modificacion'] = item.json['fecha_modificacion'] ? DateTime.fromFormat(item.json['fecha_modificacion'], 'd/M/yyyy HH:mm:ss').toSQL() : null;
  item.json['fecha_registro'] = item.json['fecha_registro'] ? DateTime.fromFormat(item.json['fecha_registro'], 'd/M/yyyy HH:mm:ss').toSQL() : null;
item.json['fecha_inicio'] = item.json['fecha_inicio'] ? DateTime.fromFormat(item.json['fecha_inicio'], 'd/M/yyyy HH:mm:ss').toSQL() : null;
  item.json['fecha_final'] = item.json['fecha_final'] ? DateTime.fromFormat(item.json['fecha_final'], 'd/M/yyyy HH:mm:ss').toSQL() : null;
  item.json['fecha_contratacion'] = item.json['fecha_contratacion'] ? DateTime.fromFormat(item.json['fecha_contratacion'], 'd/M/yyyy HH:mm:ss').toSQL() : null;
}

return $input.all();

